import { Tab, Nav, NavDropdown, NavItem } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

const SnackDropdown = () => (
  <NavDropdown eventKey="snack" title="snack">
    <NavItem
      key="cheetos"
      eventKey="cheetos"
      onClick={() => {
        console.log("cheetos");
      }}
    >
      cheetos
    </NavItem>
  </NavDropdown>
);

const Topbar = () => {
  const [activeKey, setActiveKey] = useState("pizza");
  return (
    <Tab.Container
      activeKey={activeKey}
      onSelect={(nextActiveKey) => setActiveKey(nextActiveKey)}
    >
      <>
        <Nav bsStyle="tabs">
          <NavDropdown eventKey="food" title="food">
            <NavItem
              key="pizza"
              eventKey="pizza"
              onClick={() => {
                console.log("pizza");
              }}
            >
              Pizza
            </NavItem>
          </NavDropdown>
          <SnackDropdown />
          <NavDropdown eventKey="drink" title="drink">
            <NavItem
              key="whiskey"
              eventKey="whiskey"
              onClick={() => {
                console.log("whiskey");
              }}
            >
              Whiskey
            </NavItem>
          </NavDropdown>
        </Nav>
        <Tab.Content animation>
          <Tab.Pane eventKey="pizza">
            <h1>Pizza</h1>
          </Tab.Pane>
          <Tab.Pane eventKey="whiskey">
            <h1>whiskey</h1>
          </Tab.Pane>
          <Tab.Pane eventKey="cheetos">
            <h1>Cheetos</h1>
          </Tab.Pane>
        </Tab.Content>
      </>
    </Tab.Container>
  );
};

export default Topbar;
